Une organisation non gouvernementale (ONG) est une association à but non lucratif, d'intérêt public, qui ne relève ni de l'État, ni d'institutions internationales. Les ONG n'ont pas le statut de sujet de droit international. L'habitude est de réserver le terme aux personnes morales à but non lucratif financées par des fonds privés. Les principaux critères définissant une ONG sont : 
* le but non lucratif de son action ; 
* l'indépendance financière ; 
* l'indépendance politique ; 
* la notion d'intérêt public. Une ONG est une personne morale qui, bien que n'étant pas un gouvernement, intervient dans le champ national ou international. Les relations juridiques internationales sont traditionnellement des relations uniquement entre États (ou entre Gouvernements). On considère parfois le Comité international de la Croix-Rouge (CICR) comme l'ancêtre des ONG, bien qu'ayant un statut hybride spécifique vis-à-vis des États. Dans le cas d'organisations internationales, on parle également d'Association de solidarité internationale (ASI) ou d'organisations non gouvernementales internationales. En France, le secteur des ASI emploie près de 51 000 personnes en équivalent temps-plein dont 71% de salariés.
